import React, { useState, useEffect } from 'react';
import ReactDOM from 'react-dom';
import axios from 'axios'

const NavComp = ({kategoris, gantiKategori, aktif}) => {
	console.log(kategoris)
	return(
		<div className="container">
			<div>
				{kategoris && kategoris.map(kategori => {
					return(
						<button
							key={kategori.id}
							onClick={() => {gantiKategori(kategori.nama)}}
							className={aktif === kategori.nama ? "aktif" : undefined}
							>{kategori.nama}
						</button>
					)
				})}
			</div>
			<h1 className="kategori">Kategori Pesanan</h1>
		</div>
	)
}

export default NavComp;
